import React, { useState } from 'react';
import {
  Box,
  Tabs,
  Tab,
  Typography,
  Paper,
  Button,
  Chip,
  Grid,
  Container
} from '@mui/material';
import DirectionsBusIcon from '@mui/icons-material/DirectionsBus';
import TrainIcon from '@mui/icons-material/Train';
import FlightIcon from '@mui/icons-material/Flight';
import AcUnitIcon from '@mui/icons-material/AcUnit';
import HotelIcon from '@mui/icons-material/Hotel';
import WaterDropIcon from '@mui/icons-material/WaterDrop';
import WifiIcon from '@mui/icons-material/Wifi';
import PowerIcon from '@mui/icons-material/Power';
import RestaurantIcon from '@mui/icons-material/Restaurant';
import WorkIcon from '@mui/icons-material/Work';
import TvIcon from '@mui/icons-material/Tv';
import AirlineSeatReclineExtraIcon from '@mui/icons-material/AirlineSeatReclineExtra';
import StarsIcon from '@mui/icons-material/Stars';
import { useNavigate } from 'react-router-dom';

const getRouteMultiplier = (from, to) => {
  // Example: Different routes have different multipliers
  if ((from === 'Hyderabad' && to === 'Bangalore') || (from === 'Bangalore' && to === 'Hyderabad')) {
    return 1.0; // base price
  } else if ((from === 'Chennai' && to === 'Mumbai') || (from === 'Mumbai' && to === 'Chennai')) {
    return 1.3; // 30% more expensive
  } else if ((from === 'Hyderabad' && to === 'Chennai') || (from === 'Chennai' && to === 'Hyderabad')) {
    return 0.8; // 20% cheaper
  } else {
    return 1.1; // default: 10% more
  }
};

const SearchResults = ({ from, to, date }) => {
  const [activeTab, setActiveTab] = useState('all');
  const navigate = useNavigate();

  const handleTabChange = (event, newValue) => {
    setActiveTab(newValue);
  };

  const multiplier = getRouteMultiplier(from, to);

  const transportOptions = [
    {
      type: 'bus',
      icon: <DirectionsBusIcon sx={{ fontSize: 40, color: '#3b82f6' }} />,
      title: 'Bus',
      approxTime: 'Approx. 8h journey',
      priceRange: '₹600 - ₹800'
    },
    {
      type: 'train',
      icon: <TrainIcon sx={{ fontSize: 40, color: '#22c55e' }} />,
      title: 'Train',
      approxTime: 'Approx. 10h journey',
      priceRange: '₹450 - ₹1200'
    },
    {
      type: 'flight',
      icon: <FlightIcon sx={{ fontSize: 40, color: '#a855f7' }} />,
      title: 'Flight',
      approxTime: 'Approx. 1.5h journey',
      priceRange: '₹3800 - ₹4500'
    }
  ];

  const travelOptions = [
    {
      type: 'bus',
      name: 'Express Deluxe',
      operator: 'State Express',
      departure: '08:00',
      arrival: '16:00',
      duration: '8h 0m',
      price: 600,
      features: ['AC', 'Sleeper', 'Water Bottle', 'Charging Point'],
      icons: {
        'AC': <AcUnitIcon />,
        'Sleeper': <HotelIcon />,
        'Water Bottle': <WaterDropIcon />,
        'Charging Point': <PowerIcon />
      }
    },
    {
      type: 'bus',
      name: 'Luxury AC',
      operator: 'Private Travels',
      departure: '21:00',
      arrival: '05:00',
      duration: '8h 0m',
      price: 800,
      features: ['AC', 'Sleeper', 'Blanket', 'Charging Point', 'WiFi'],
      icons: {
        'AC': <AcUnitIcon />,
        'Sleeper': <HotelIcon />,
        'Blanket': <HotelIcon />,
        'Charging Point': <PowerIcon />,
        'WiFi': <WifiIcon />
      }
    },
    {
      type: 'bus',
      name: 'Royal Cruiser',
      operator: 'Premium Bus Lines',
      departure: '15:30',
      arrival: '23:30',
      duration: '8h 0m',
      price: 950,
      features: ['Premium AC', 'Individual TV', 'Meals Included', 'USB Charging', 'WiFi', 'Extra Legroom'],
      icons: {
        'Premium AC': <AcUnitIcon />,
        'Individual TV': <TvIcon />,
        'Meals Included': <RestaurantIcon />,
        'USB Charging': <PowerIcon />,
        'WiFi': <WifiIcon />,
        'Extra Legroom': <AirlineSeatReclineExtraIcon />
      }
    },
    {
      type: 'train',
      name: 'Godavari Express',
      operator: 'Indian Railways',
      departure: '19:30',
      arrival: '06:15',
      duration: '10h 45m',
      price: 450,
      features: ['Sleeper Class', 'Food Available', 'Charging Point'],
      icons: {
        'Sleeper Class': <HotelIcon />,
        'Food Available': <RestaurantIcon />,
        'Charging Point': <PowerIcon />
      }
    },
    {
      type: 'train',
      name: 'Rajdhani Express',
      operator: 'Indian Railways',
      departure: '16:00',
      arrival: '02:30',
      duration: '10h 30m',
      price: 850,
      features: ['AC First Class', 'Premium Meals', 'Charging Point', 'WiFi', 'Blanket'],
      icons: {
        'AC First Class': <AcUnitIcon />,
        'Premium Meals': <RestaurantIcon />,
        'Charging Point': <PowerIcon />,
        'WiFi': <WifiIcon />,
        'Blanket': <HotelIcon />
      }
    },
    {
      type: 'train',
      name: 'Shatabdi Express',
      operator: 'Indian Railways',
      departure: '06:00',
      arrival: '16:15',
      duration: '10h 15m',
      price: 750,
      features: ['Executive Chair Car', 'Breakfast & Lunch', 'Charging Point', 'WiFi', 'Premium Service'],
      icons: {
        'Executive Chair Car': <AirlineSeatReclineExtraIcon />,
        'Breakfast & Lunch': <RestaurantIcon />,
        'Charging Point': <PowerIcon />,
        'WiFi': <WifiIcon />,
        'Premium Service': <StarsIcon />
      }
    },
    {
      type: 'flight',
      name: 'Express Air',
      operator: 'Express Airways',
      departure: '10:00',
      arrival: '11:30',
      duration: '1h 30m',
      price: 3800,
      features: ['Meal Included', 'Baggage 15kg', 'Entertainment', 'Charging Point'],
      icons: {
        'Meal Included': <RestaurantIcon />,
        'Baggage 15kg': <WorkIcon />,
        'Entertainment': <TvIcon />,
        'Charging Point': <PowerIcon />
      }
    },
    {
      type: 'flight',
      name: 'Swift Air',
      operator: 'Swift Airlines',
      departure: '14:30',
      arrival: '16:00',
      duration: '1h 30m',
      price: 4200,
      features: ['Meal Included', 'Baggage 20kg', 'Entertainment', 'WiFi', 'Extra Legroom'],
      icons: {
        'Meal Included': <RestaurantIcon />,
        'Baggage 20kg': <WorkIcon />,
        'Entertainment': <TvIcon />,
        'WiFi': <WifiIcon />,
        'Extra Legroom': <AirlineSeatReclineExtraIcon />
      }
    },
    {
      type: 'flight',
      name: 'Premium Air',
      operator: 'Premium Airlines',
      departure: '18:00',
      arrival: '19:30',
      duration: '1h 30m',
      price: 4500,
      features: ['Premium Meal', 'Baggage 25kg', 'Entertainment', 'WiFi', 'Extra Legroom', 'Lounge Access'],
      icons: {
        'Premium Meal': <RestaurantIcon />,
        'Baggage 25kg': <WorkIcon />,
        'Entertainment': <TvIcon />,
        'WiFi': <WifiIcon />,
        'Extra Legroom': <AirlineSeatReclineExtraIcon />,
        'Lounge Access': <StarsIcon />
      }
    }
  ].map(option => ({
    ...option,
    price: Math.round(option.price * multiplier)
  }));

  const filteredOptions = activeTab === 'all' 
    ? travelOptions 
    : travelOptions.filter(option => option.type === activeTab);

  return (
    <Container maxWidth="lg" sx={{ mt: 4 }}>
      {/* Transport Type Summary Cards */}
      <Grid container spacing={3} sx={{ mb: 4 }}>
        {transportOptions.map((option) => (
          <Grid item xs={12} sm={6} md={4} key={option.type}>
            <Paper
              elevation={1}
              sx={{
                p: 3,
                display: 'flex',
                alignItems: 'center',
                gap: 2,
                borderRadius: 2,
                cursor: 'pointer',
                transition: 'transform 0.2s',
                '&:hover': {
                  transform: 'translateY(-2px)',
                }
              }}
              onClick={() => setActiveTab(option.type)}
            >
              <Box sx={{
                width: 56,
                height: 56,
                borderRadius: '50%',
                display: 'flex',
                alignItems: 'center',
                justifyContent: 'center',
                backgroundColor: option.type === 'bus' ? '#eff6ff' : 
                               option.type === 'train' ? '#f0fdf4' : '#faf5ff'
              }}>
                {option.icon}
              </Box>
              <Box>
                <Typography variant="h6" gutterBottom>
                  {option.title}
                </Typography>
                <Typography variant="body2" color="text.secondary" gutterBottom>
                  {option.approxTime}
                </Typography>
                <Typography variant="subtitle1" fontWeight="bold">
                  {option.priceRange}
                </Typography>
              </Box>
            </Paper>
          </Grid>
        ))}
      </Grid>

      {/* Tabs */}
      <Box sx={{ borderBottom: 1, borderColor: 'divider', mb: 3 }}>
        <Tabs value={activeTab} onChange={handleTabChange}>
          <Tab label="All Options" value="all" />
          <Tab label="Bus" value="bus" />
          <Tab label="Train" value="train" />
          <Tab label="Flight" value="flight" />
        </Tabs>
      </Box>

      {/* Travel Options */}
      <Box sx={{ mb: 4 }}>
        {filteredOptions.map((option, index) => (
          <Paper
            key={index}
            elevation={1}
            sx={{
              p: 3,
              mb: 2,
              borderRadius: 2,
            }}
          >
            <Grid container spacing={2} alignItems="center">
              {/* Transport Type */}
              <Grid item xs={12} sm={3}>
                <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
                  <Chip 
                    label={option.type.charAt(0).toUpperCase() + option.type.slice(1)}
                    color={option.type === 'bus' ? 'primary' : 
                           option.type === 'train' ? 'success' : 'secondary'}
                    size="small"
                  />
                  <Typography variant="h6">{option.name}</Typography>
                </Box>
                <Typography variant="body2" color="text.secondary">
                  {option.operator}
                </Typography>
              </Grid>

              {/* Time Details */}
              <Grid item xs={12} sm={4}>
                <Box sx={{ display: 'flex', alignItems: 'center', gap: 2 }}>
                  <Box>
                    <Typography variant="h6">{option.departure}</Typography>
                    <Typography variant="body2" color="text.secondary">
                      Departure
                    </Typography>
                  </Box>
                  <Box sx={{ flex: 1, textAlign: 'center', color: 'text.secondary' }}>
                    <Typography variant="body2">{option.duration}</Typography>
                  </Box>
                  <Box>
                    <Typography variant="h6">{option.arrival}</Typography>
                    <Typography variant="body2" color="text.secondary">
                      Arrival
                    </Typography>
                  </Box>
                </Box>
              </Grid>

              {/* Features */}
              <Grid item xs={12} sm={3}>
                <Typography variant="subtitle2" gutterBottom>Features:</Typography>
                <Box sx={{ display: 'flex', flexWrap: 'wrap', gap: 1 }}>
                  {option.features.map((feature, idx) => (
                    <Chip
                      key={idx}
                      icon={option.icons[feature]}
                      label={feature}
                      size="small"
                      variant="outlined"
                    />
                  ))}
                </Box>
              </Grid>

              {/* Price and Book Button */}
              <Grid item xs={12} sm={2}>
                <Box sx={{ textAlign: 'right' }}>
                  <Typography variant="h6" gutterBottom>
                    ₹{option.price}
                  </Typography>
                  <Typography variant="body2" color="text.secondary" gutterBottom>
                    per person
                  </Typography>
                  <Button
                    variant="contained"
                    fullWidth
                    sx={{
                      mt: 1,
                      bgcolor: '#1a73e8',
                      '&:hover': {
                        bgcolor: '#1557b0'
                      }
                    }}
                    onClick={() => navigate('/payment')}
                  >
                    Book Now
                  </Button>
                </Box>
              </Grid>
            </Grid>
          </Paper>
        ))}
      </Box>
    </Container>
  );
};

export default SearchResults;
